        <p>{props.product.description}</p>
        <p>price : {props.product.price}</p>
        <button onClick={() => {
            console.log('i will buy this product ', props.product.price);
            total_price += props.product.price.value;
        }}>Buy</button>

        console.log({total_price});


    </div>);
}

export default Product;
